let filesCount = -1;

let parsedFiles = {
    count: filesCount,
    files: []
};

if (msg.req !== undefined && msg.req.files !== undefined){
    let allFiles = msg.req.files;

    if (Array.isArray(allFiles)){
        filesCount = allFiles.length;
        parsedFiles.count = filesCount;
        allFiles.forEach(
            file => {
                let newFileDesc = {
                    name: file.originalname,
                };

                if (file.buffer !== undefined){
                    let contentB64 = file.buffer.toString('base64');                    
                    newFileDesc.content = contentB64;

                }
                parsedFiles.files.push(newFileDesc);
            }
        )
    }
}


//msg.payload = `got ${filesCount} files`;
msg.payload = parsedFiles;

return [msg, {payload: msg.payload}];

if (crypto !== undefined){
    if (
        msg.payload.files !== undefined 
        && 
        Array.isArray(msg.payload.files)
    ){
        let files = msg.payload.files;

        files.forEach(
            file => {
                if (file.content !== undefined){
                    let content = file.content;
                    file.checksum = crypto
                                        .createHash('sha1')
                                        .update(content)
                                        .digest('hex');
                }
            }
        )
    }
}


return msg;

let report = msg.payload;

let requestStore = flow.get("saved-requests");
if (requestStore === undefined){
    flow.set("saved-requests",{});
    requestStore = flow.get("saved-requests");
}

if (
    report.files !== undefined 
    && Array.isArray(report.files)
){
    let files = report.files;
    files.forEach(
        file => {
            if (file.content !== undefined){
                delete(file.content);
            }
        }
    )
}

msg.payload = report;

let savedMsg = {
    req: msg.req,
    res: msg.res,
    payload: msg.payload
};

// flow.set(msg._msgid, savedMsg);

requestStore[msg._msgid] = savedMsg;

return msg;

