msg.fullDxf = {...msg.payload};

msg.payload = [
    {
        name: msg.fullDxf.name
    }, 
    {
        sort: {
                version: -1
              },
        projection: {
                        content: 0
                    }
    }
];

return msg;

if (
    msg.payload.files !== undefined 
    && Array.isArray(msg.payload.files)
){
    let files = msg.payload.files;

    files.forEach(
        file => {
            let newMsg = {...msg};
            newMsg.payload = file;
            node.send(newMsg);
        }
    );
}

let needInsert = true;

let fullDxf = {...msg.fullDxf};
delete(msg.fullDxf);

let latestVersion = 0;

if (Array.isArray(msg.payload)){
    msg.payload.forEach(
        doc => {
            if (doc.checksum === fullDxf.checksum){
                needInsert = false;
            }
        }
    )
    if (msg.payload.length > 0){
        let lastKnownVersion = msg.payload[0].version;
        if (lastKnownVersion !== undefined){
            latestVersion = lastKnownVersion;
        }
    }
}

if (!needInsert){
    node.send([null,msg]);
} 
else 
{
    latestVersion += 1;
    let receivedOn = new Date();
    delete(msg.payload);
    msg.payload = {...fullDxf};
    msg.payload.version = latestVersion;
    msg.payload.receivedOn = receivedOn;

    msg.info = {
        name: msg.payload.name,
        checksum: msg.payload.checksum,
        version: msg.payload.version,
        receivedOn: msg.payload.receivedOn
    }

    node.send([msg, null]);
}

let receivedDrawing = {};

if (
    msg.payload.parsedDrawings !== undefined
    && Array.isArray(msg.payload.parsedDrawings)
){
    let parsedDrawings = msg.payload.parsedDrawings;
    if (parsedDrawings.length > 0){
        receivedDrawing = {...parsedDrawings[0]};
    }
} else {
    receivedDrawing = {...msg.payload};
}

msg.payload = receivedDrawing;

return msg;

msg.payload.checksum = msg.info.checksum;
msg.payload.version = msg.info.version;
msg.payload.receivedOn = msg.info.receivedOn;

// pass document to next stages
msg.dxfDrawing = { ...msg.payload };

return msg;

msg.sourceDxfId = msg.payload.insertedId;

let dxfBlocks = msg.dxfDrawing.content.blocks;

for (const blockName in dxfBlocks){
  let newBlock = {
        name: blockName,
        ...dxfBlocks[blockName]
      };
  node.send(
      {
        drawingInfo: msg.info,
        sourceDxfId: msg.sourceDxfId,
        payload: newBlock
      }
    );  
}

msg.blockData = {...msg.payload};

msg.payload = [
    {
        name: msg.blockData.name
    },
    {
        sort: {
            version: -1
        }
    }
];

return msg;

if (crypto !== undefined) {
    if (
        msg.payload.files !== undefined
        &&
        Array.isArray(msg.payload.files)
    ) {
        let files = msg.payload.files;

        files.forEach(
            file => {
                if (file.content !== undefined) {
                    let content = file.content;

                }
            }
        )
    }
}

let checksum = crypto
                .createHash('sha1')
                .update(JSON.stringify(msg.payload))
                .digest('hex');

msg.payload.checksum = checksum;

msg.blockInfo = {
    checksum: checksum,
    receivedOn: msg.drawingInfo.receivedOn
}

return msg;

let blockData = {...msg.blockData};
delete(msg.blockData);

let needInsert = true;

let latestVersion = 0;

if (Array.isArray(msg.payload)) {
    msg.payload.forEach(
        doc => {
            if (doc.checksum === blockData.checksum) {
                needInsert = false;
                blockData.blockId = doc._id;
            }
        }
    )
    if (msg.payload.length > 0) {
        let lastKnownVersion = msg.payload[0].version;
        if (lastKnownVersion !== undefined) {
            latestVersion = lastKnownVersion;
        }
    }
}

msg.blockInfo.name = blockData.name;
msg.blockInfo.version = latestVersion;

if (needInsert) {
    latestVersion += 1;

    msg.payload = { 
            ...blockData,
            ...msg.blockInfo
        };

    msg.blockEntities = blockData.entities;

    node.send([msg,null]);
} else {
    let output = {
        blockStatus: 'block-exists',
        ...msg
    }
    delete(output.payload);
    output.payload = {
        insertedId: blockData.blockId
    };

    node.send(
        [
            null,
            output
        ]
    );
}

let filterPredicates = 
[
    str => str.startsWith("*"),
    str => str.startsWith("_")
];

let passed = true;

let blockName = msg.payload.name;

if (blockName === undefined){
    passed = false;
} else {
    filterPredicates.forEach(
        predicate => {
            if (predicate(blockName)) {
                passed = false;
            }
        }
    )

}

if (passed){
    node.send(msg);
}

msg.status = "file-parsed";
msg.payload = {
    fileId: msg.payload.insertedId
};
return msg;

msg.status = "file-exists";
msg.payload = msg.payload[0];
return msg;

let dxfLayers = msg.dxfDrawing.content.tables.layer.layers;

for (const layerName in dxfLayers) {
    let newLayer = {
        ...dxfLayers[layerName]
    };

    let output = {...msg};
    output.payload = newLayer;

    node.send(output);
}

let filterPredicates =
    [
        str => str.includes("WALL")
    ];

let passed = false;

