    [
        str => str.startsWith("*"),
        str => str.startsWith("_")
    ];

let dxfBlocks = msg.dxfDrawing.content.blocks;
let blockCount = 0;
for (let blockName in dxfBlocks){
    let passed = true;
    filterPredicates.forEach(
        predicate => {
            if (predicate(blockName)) {
                passed = false;
            }
        }
    )
    if (passed){
        blockCount++;
    }
}

savedBlocks[msg._msgid] = {
    name: msg.dxfDrawing.name,
    version: msg.dxfDrawing.version,
    blockCount: blockCount
};

return flow.get("savedBlocks")[msg._msgid];

function isWorkDone(aggregate){
    let result = false;

    if (
        aggregate.blocks !== undefined
        && aggregate.walls !== undefined
    ){
        result = true;
    }

    return result;
}

const aggregateFeedbackHandlers = {
    "file-exists":
        message => {
            node.send([
                    null,
                    {
                        name: message.payload.name,
                        version: message.payload.version,
                        payload: [
                            {
                                name: message.payload.name,
                                version: message.payload.version
                            }
                        ]
                    }
                ]
            );
        },
    "file-parsed":
        message => {
            let aggregate = flow.get("parse-aggregates")[msg._msgid];

            if (aggregate === undefined) {
                flow.get("parse-aggregates")[msg._msgid] = {};
                aggregate = flow.get("parse-aggregates")[msg._msgid];
            }

            if (aggregate.files === undefined){
                aggregate.files = {};
            }
            aggregate.files[message.dxfDrawing.name] = {
                name: message.dxfDrawing.name,
                version: message.dxfDrawing.version,
                ...msg.payload
            };

        },
    "blocks-ready":
        message => {
            let aggregate = flow.get("parse-aggregates")[msg._msgid];
            let file = aggregate.files[message.payload.name];
            file.blockCount = msg.payload.blockCount;
            file.blocks = msg.payload.processedBlocks;

            if (isWorkDone(file)){
                let output = { ...msg };
                output.fileIndex = {...file};
                output.payload = file;
                node.send([output, null]);
            }
        },
    "walls-ready":
        message => {
            let aggregate = flow.get("parse-aggregates")[msg._msgid];
            let file = aggregate.files[message.payload.name];
            file.wallCount = msg.payload.wallCount;
            file.walls = msg.payload.walls;

            if (isWorkDone(file)) {
                let output = { ...msg };
                output.fileIndex = { ...file };
                output.payload = file;
                node.send([output, null]);
            }
        }
}



if (
    msg.status !== undefined
){
    if (msg.status in aggregateFeedbackHandlers){
        aggregateFeedbackHandlers[msg.status](msg);
    }
}

