const plumbingBlockNameChecks = 
[
    "унитаз",
    "стиральная",
    "ванна",
    "душ",
    "мойка",
    "кухня"
];

let blockInfo = {...msg.blockInfo};

if (msg.payload.insertedId !== undefined){
    blockInfo.blockId = msg.payload.insertedId;
}

const plumbEntityChecks = [
    "СТОЯК",
    "CONNECTION POINT"
];

let plumbingBlock = null;
let nonPlumbingBlock = null;

// first attempt - look for the connection points
// inside the block
// which tells that this block needs plumbing
let entities = msg.blockEntities;
if (
    entities !== undefined 
    && Array.isArray(entities)
) {
    entities.forEach(
        entity => {
            if (
                entity.type === "INSERT"
            ){
                plumbEntityChecks.forEach(
                    checkStr => {
                        if (entity.name.includes(checkStr)){
                            plumbingBlock = {
                                blockType: "plumbing-block",
                                ...msg    
                            };
                            delete(plumbingBlock.payload);
                            plumbingBlock.payload = {
                                ...blockInfo
                            }
                        }
                    }
                )
            }
        }
    )
}

// second attempt
// if block does not have a connection point yet
// but its name contains the keywords
if (plumbingBlock === null){

    plumbingBlockNameChecks.forEach(
        checkStr => {
            if (blockInfo.name.toLowerCase().includes(checkStr)){
                plumbingBlock = {
                    blockType: "plumbing-block",
                    ...msg
                };
                delete(plumbingBlock.payload);
                plumbingBlock.payload = {
                                            ...blockInfo
                                        }
            }
        }
    )
}

// it's a door or other equipment
if (plumbingBlock === null){
    nonPlumbingBlock = {
        blockType: "non-plumbing-block",
        ...msg
    };
    delete(nonPlumbingBlock.payload);
    nonPlumbingBlock.payload = {
                                    ...blockInfo
                                }
}
return [plumbingBlock,nonPlumbingBlock];

