let allEntities = msg.dxfDrawing.content.entities;

let output = {...msg};

output.payload = {
    dxfName: msg.dxfDrawing.name,
    dxfVersion: msg.dxfDrawing.version,
    dxfReceivedOn: msg.dxfDrawing.receivedOn,
    ...msg.payload
}

let wallName = msg.payload.name;

output.payload.parts = allEntities.filter(
    entity => entity.layer === wallName
)

return output;

msg.wallInfo = {...msg.payload};
msg.payload = [
    {
        name: msg.wallInfo.name,
        dxfName: msg.wallInfo.dxfName,
        dxfVersion: msg.wallInfo.dxfVersion
    }
];
return msg;

if (msg.payload !== null){
    let output = {...msg};
    output.wallStatus = "wall-exists",
    output.payload = {
        insertedId: msg.payload._id
    }
    node.send([null, output]);
} else {
    let output = {...msg};
    output.payload = {...msg.wallInfo};
    node.send([output, null]);
}

let feedbackAggr = flow.get("savedLayers")[msg._msgid];

if (feedbackAggr.layers === undefined){
    feedbackAggr.layers = [];
}

feedbackAggr.layers.push({...msg.wallInfo});

if (feedbackAggr.layers.length === feedbackAggr.layerCount){

    let processedWalls = feedbackAggr.layers.map(
        layer => {
            let output = {
                type: "wall",
                name: layer.name,
                id: layer.wallId,
                dxfName: layer.dxfName,
                dxfVersion: layer.dxfVersion
            }
            return output;
        }
    );

    let output = {
        wallCount: feedbackAggr.layerCount,
        name: feedbackAggr.name,
        version: feedbackAggr.version,
        walls: processedWalls
    };

    node.send(
        {
            status: "walls-ready",
            payload: output
        }
    );
}
